import React from "react";
// import logo from "./logo.svg";
import "./App.css";
import Header from "./components/Header";
import Body from "./components/Body";
function App() {
  return (
    <React.Fragment>
      <Header></Header>
      <Body></Body>
    </React.Fragment>
  );
}

export default App;
